        int end=i+len;
        if(end>bb.limit()){
            throw new IllegalArgumentException("Malformed UTF-8");
        }
        int val=c&(0xFF>>extra);
        while(i<end){
            c=bb.get(i);
            if((c&0xC0)!=0x80){
