    out.writeByte(OBJECT);
    size += 1;
    final int fieldCount = node.size();
    out.writeShort(fieldCount);
    size += 2;
    for (int i = 0; i < fieldCount; i++) {
        final NodeTuple tuple = node.get(i);
        final int keySize = writeTo(out, tuple.getKey());
        size += keySize;
        final int valueSize = writeTo(out, tuple.getValue());
        size += valueSize;
    }
    return size;
}

@Override public String readString() throws IOException {
int len = readInt();
    byte[] buf = new byte[len];
    readFully(buf);
    return new String(buf, 0, len);
}

public final byte[] toByteArray(){
byte[] bytes = new byte[size];
    int pos = 0;
    for (LinkedBuffer buffer : buffers) {
        int length = buffer.size;
        System.arraycopy(buffer.buffer, 0, bytes, pos, length);
        pos += length;
    }
    return bytes;
}

